		<div className="task-list">

      {data.map(({title},index) => (

        <div className="task-item">
          <p>{title}</p>
          <i class="bx bx-x-circle"></i>
          <i class="bx bx-edit-alt"></i>
        </div>
      ))}
		</div>
  );
}


export default TaskItem
